import {useParams} from 'react-router-dom'; 
import {useState, useEffect} from 'react';

import './PropertyInfo.css'; 

export default function PropertyInfo () {
    const { id } = useParams(); 
    const [images, setImages] = useState([]); 
    const [propertyDetail, setPropertyDetail] = useState({});

    useEffect(() => {
        const getProperty = async () => {
            try {
                const response = await fetch(
                    `http://127.0.0.1:8000/api/buy/?id=${id}`, 
                    {
                        method: "GET", 
                        headers: {
                            // "Authorization": `JWT ${jwt.access}` 
                        }
                    }
                )
                const data = await response.json(); 
                setImages(data[0].images.map((images)=> images.image));
                setPropertyDetail({...data[0], images: undefined});
            } 
            catch (error) {
                console.log(error)
            }
        }

        getProperty(); 
    }, [])

    if (propertyDetail) {
        console.log(propertyDetail);
    }

    return (
        <div>
            <div className='three-column-container'>
                <div className='images'>
                    <img 
                        className='image-lead' 
                        src={images[0]}
                    />
                </div>
                <div className='buy-sell-tab'>
                    Buy/Sell 
                </div>
            </div>
            <div className='three-column-container'> 
                <div className='price-chart'>
                    Property location, description and such 
                </div>
                <div className='bid-ask-chart'>
                    Bid/ask chart
                </div>
            </div>

        </div>

    )
}
